import React from "react";
import "./FriendCard.css";

const FriendCard = (props) => (
  <div className="card">
    <div className="img-container imageBox">
      <img
        alt={props.name}
        src={props.image}
      />
    </div>
    {/* <div className="name">
      <strong>Name:</strong> {props.name}
    </div> */}
  </div>
)

export default FriendCard;
